  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0121197 contains raw underway
  meteorological, navigational, optical, physical, profile and time series data logged
  by the Scientific Computer System (SCS) aboard NOAA Ship Pisces in the North Atlantic
